import React from "react";

const PlaceListComponent = ({ gyms }) => {
    return (
        <div>
            <h2>근처 헬스장 목록</h2>
            <ul>
                {gyms.map((gym, index) => (
                    <li key={index}>{gym.title}</li>
                ))}
            </ul>
        </div>
    );
};

export default PlaceListComponent;
